import{_ as o,c as i,o as a,a5 as t}from"./chunks/framework.CqnjdYks.js";const s="/docs/cocos/assets/project.BeTAe040.png",r="/docs/cocos/assets/cc-build-menu.BDHu90YZ.png",e="/docs/cocos/assets/new-build-task.CHOdkRpj.png",p="/docs/cocos/assets/select-platform.BpY9ctA7.png",d="/docs/cocos/assets/start-scene.BendNmNC.png",l="/docs/cocos/assets/render-backend.DTbGkYff.png",n="/docs/cocos/assets/game-package-name.ClGXU0p8.png",c="/docs/cocos/assets/target-api-level.B0jUDL27.png",A="/docs/cocos/assets/build.BxDLPR3F.png",g="/docs/cocos/assets/building.Cg451itJ.png",u="/docs/cocos/assets/open.CGON8Pq1.png",m="/docs/cocos/assets/find-proj.6s93KK5p.png",h="/docs/cocos/assets/as-open-menu.DmP_yn5g.png",b="/docs/cocos/assets/as-open-proj.BRonVtVF.png",C="data:image/png;base64,",I="data:image/png;base64,",f="/docs/cocos/assets/build-apk.BYzmI62c.png",K="/docs/cocos/assets/apk.DWEMU9i-.png",S="/docs/cocos/assets/gen-sign-apk.C3FWSjwe.png",B="/docs/cocos/assets/gen-apk.nFYQHkWL.png",k="/docs/cocos/assets/create-sign.Dxdmm4fw.png",q="/docs/cocos/assets/android-keystore-panel.DGxWQ13D.png",P="/docs/cocos/assets/debug-keystore.Bb6KqSlW.png",F="/docs/cocos/assets/show-log.DwYSRN9F.png",T=JSON.parse('{"title":"安卓构建示例","description":"","frontmatter":{},"headers":[],"relativePath":"zh/manual/editor/publish/android/build-example-android.md","filePath":"zh/manual/editor/publish/android/build-example-android.md"}'),X={name:"zh/manual/editor/publish/android/build-example-android.md"},j=t('<h1 id="安卓构建示例" tabindex="-1">安卓构建示例 <a class="header-anchor" href="#安卓构建示例" aria-label="Permalink to &quot;安卓构建示例&quot;">​</a></h1><p>本文将演示 Cocos Creator 项目发布为 Android 应用程序的流程。</p><p>请准备一个至少含有一个场景的 Cocos Creator 项目。</p><p><img src="'+s+'" alt="project.png"></p><h2 id="发布环境搭建" tabindex="-1">发布环境搭建 <a class="header-anchor" href="#发布环境搭建" aria-label="Permalink to &quot;发布环境搭建&quot;">​</a></h2><p>要想发布 Android 原生应用，需要安装 Android Studio 开发环境，以及特定版本的 JDK（或者 OpenSDK），Android SDK 和 NDK 等。详情请参考 <a href="./build-setup-evn-android.html">配置 Android 原生开发环境</a>。</p><h2 id="发布流程" tabindex="-1">发布流程 <a class="header-anchor" href="#发布流程" aria-label="Permalink to &quot;发布流程&quot;">​</a></h2><p>接下来，在 Cocos Creator 找到 <strong>项目</strong> 菜单，点击 <strong>构建发布</strong> 按钮，弹出 <strong>构建发布</strong> 面板。</p><h3 id="创建发布任务" tabindex="-1">创建发布任务 <a class="header-anchor" href="#创建发布任务" aria-label="Permalink to &quot;创建发布任务&quot;">​</a></h3><ol><li><p>选择 <strong>项目</strong> -&gt; <strong>构建</strong> 菜单，打开构建面板</p><p><img src="'+r+'" alt="cc-build-menu.png"></p></li><li><p>点击面板上的 <strong>新建构建任务</strong> 选项：</p><p><img src="'+e+'" alt="new-build-task.png"></p></li><li><p>选择构建平台为安卓：</p><p><img src="'+p+'" alt="select-platform.png"></p></li><li><p>选择至少一个场景作为应用载入的首场景，当仅有一个场景时会被默认添加：</p><p><img src="'+d+'" alt="start-scene.png"></p></li><li><p>参考 <a href="./../native-options.html#渲染后端">Android 平台构建选项 - 渲染后端</a> 选择渲染后端</p><p><img src="'+l+'" alt="render-backend.png"></p></li><li><p>填入包名</p><p><img src="'+n+'" alt="game-package-name.png"></p><blockquote><p>名称规范请参考 <a href="./../native-options.html#应用-id-名称">应用 ID 名称</a></p></blockquote></li><li><p>选择 Target API Level</p><p><img src="'+c+'" alt="target-api-level.png"></p><blockquote><p>如果没有下拉框，请检查上面的 <strong>配置 SDK 和 NDK</strong> 是否正确。</p></blockquote></li></ol><p>其他选项请参考 <a href="./../native-options.html#android-平台构建选项">Android 平台构建选项</a> 进行配置。</p><h3 id="构建与发布" tabindex="-1">构建与发布 <a class="header-anchor" href="#构建与发布" aria-label="Permalink to &quot;构建与发布&quot;">​</a></h3><ol><li><p>构建：点击下方的 <strong>构建</strong> 按钮会创建一个新的构建任务并开始构建</p><p><img src="'+A+'" alt="build.png"></p></li><li><p>等待构建完成</p><p><img src="'+g+'" alt="building.png"></p></li><li><p>在点击下面的按钮打开生成好的 Android Studio 工程：</p><p><img src="'+u+'" alt="open"></p></li><li><p>找到工程对应的目录</p><p><img src="'+m+'" alt="find-proj"></p></li><li><p>打开 Android Studio 的菜单：</p><p><img src="'+h+'" alt="android studio open project menu"></p></li><li><p>打开已经构建好的项目，<code>{项目路径}/build/android/proj</code>：</p><p><img src="'+b+'" alt="android studio open project"></p></li><li><p>使用 Android Studio 构建 APK</p><p>打开 Android Studio 后，会花一段时间进行准备工作，待 Android Studio 将项目准备完成后，即可打包 APK。准备过程可能会耗时较久，如果长时间无响应，请检查网络，或者切换到其他镜像。此时如果您需要中断目前的后台任务，可参考下列关闭方法：</p><blockquote><p>Android Studio 有后台任务时，可以点击窗口下方的后台任务栏： <img src="'+C+'" alt="background-task.png"> <br> 在弹出窗中点击右侧的 × 以结束后台任务： <img src="'+I+'" alt="interrupt-sync.png"></p></blockquote></li><li><p>打开 <strong>Build</strong> 菜单选择 <strong>Build Bundle(s) / APK(s)</strong>：</p><p><img src="'+f+'" alt="build-apk.png"></p></li><li><p>发布成功后可以在 proj/build 目录内找到 Debug 版本的 APK：</p><p><img src="'+K+'" alt="apk.png"></p></li></ol><h2 id="秘钥生成与使用" tabindex="-1">秘钥生成与使用 <a class="header-anchor" href="#秘钥生成与使用" aria-label="Permalink to &quot;秘钥生成与使用&quot;">​</a></h2><p>正式版本的发布，不能使用调试密钥，需要自行创建密钥。</p><h3 id="创建密钥" tabindex="-1">创建密钥 <a class="header-anchor" href="#创建密钥" aria-label="Permalink to &quot;创建密钥&quot;">​</a></h3><p>秘钥可以通过 Android Studio 来生成：</p><ol><li><p>在 Android Studio 中点击 Build 菜单，选中 Generate Signed Bundle / APK：</p><p><img src="'+S+'" alt="gen-sign-apk.png"></p></li><li><p>在弹出菜单的窗口中选择 APK，点击 Next 按钮：</p><p><img src="'+B+'" alt="gen-apk.png"></p></li><li><p>在引导的窗口中点击 Create new：</p><p><img src="'+k+'" alt="create-sign.png"></p></li><li><p>在弹出的窗口中，填好相应信息即可：</p><p><img src="'+q+'" alt="android-keystore-panel.png"></p><blockquote><p>不同的项目，建议使用不同的密钥。可以将每个项目的密钥保存在项目根目录下。</p></blockquote></li></ol><h3 id="使用密钥" tabindex="-1">使用密钥 <a class="header-anchor" href="#使用密钥" aria-label="Permalink to &quot;使用密钥&quot;">​</a></h3><p>密钥创建成功后，会在选择的目录下生成一个密钥文件，我们可以在 Android 构建面板上，将密钥信息填好。 这样不管是调试版还是发布版，都使用的是自己创建的密钥。</p><p>如下图所示，取消 <strong>使用调试秘钥</strong>，并从下方的 <strong>秘钥库路径</strong> 中找到自定义的秘钥文件，填好相关信息即可。</p><p><img src="'+P+'" alt="debug-keystore.png"></p><h3 id="注意事项" tabindex="-1">注意事项 <a class="header-anchor" href="#注意事项" aria-label="Permalink to &quot;注意事项&quot;">​</a></h3><ol><li>建议项目第一次发布时，就为项目创建一个专用的密钥。</li><li>一些 SDK 的服务接入需要 APK 密钥签名验证，使用默认的调试密钥可能导致服务调用失败。</li></ol><h2 id="进阶" tabindex="-1">进阶 <a class="header-anchor" href="#进阶" aria-label="Permalink to &quot;进阶&quot;">​</a></h2><h3 id="java-和-typescript-互相通信" tabindex="-1">JAVA 和 TypeScript 互相通信 <a class="header-anchor" href="#java-和-typescript-互相通信" aria-label="Permalink to &quot;JAVA 和 TypeScript 互相通信&quot;">​</a></h3><p>引擎提供多样化的方法用于解决 TypeScript 和 Native 层交互问题。</p><p>常见的 SDK 接入时，我们需要通过 SDK 的登陆接口进行登陆操作，获取到登陆结果后再将结果传入到 TypeScript 层以方便游戏进行处理。</p><p>引擎提供了三种用于 TS 与 Android 原生通信的方法。</p><ul><li><p><a href="./../../../advanced-topics/js-java-bridge.html">使用 JsbBridge 实现 JavaScript 与 Java 通信</a> ：用于对接 SDK 中如注册、登陆、广告弹出等行为是非常方便的，可以较为快速的解决这类问题。</p></li><li><p><a href="./../../../advanced-topics/JSB2.0-learning.html">JSB 2.0 绑定教程</a>：需要高频调用，或者批量导出 API 时，推荐使用这个方法。</p></li><li><p><a href="./../../../advanced-topics/java-reflection.html">基于反射机制实现 JavaScript 与 Android 系统原生通信</a> ：在一些非高频调用时，非常有效。</p></li></ul><h3 id="导入第三方库" tabindex="-1">导入第三方库 <a class="header-anchor" href="#导入第三方库" aria-label="Permalink to &quot;导入第三方库&quot;">​</a></h3><p>为了将应用发布到应用市场，通常需要对接某些第三方的 SDK，通常这些 SDK 会提供给您 JAR 或 AAR 格式，您可以参考 <a href="https://developer.android.com/studio/projects/android-library?hl=zh-cn#psd-add-library-dependency" target="_blank" rel="noreferrer">在其他项目中使用您的库</a> 将本地的库导入到工程内。</p><h3 id="扩展发布机制" tabindex="-1">扩展发布机制 <a class="header-anchor" href="#扩展发布机制" aria-label="Permalink to &quot;扩展发布机制&quot;">​</a></h3><p>参考 <a href="./../custom-build-plugin.html">自定义构建流程</a> 通过扩展系统对发布机制进行扩展。</p><h2 id="q-a" tabindex="-1">Q&amp;A <a class="header-anchor" href="#q-a" aria-label="Permalink to &quot;Q&amp;A&quot;">​</a></h2><ul><li><p>Q：发布时的错误如何调试</p><ul><li><p>A：点击日志按钮，进行查看</p><p><img src="'+F+'" alt="show-log.png"></p></li></ul></li><li><p>Q：提示缺少 LIB_EGL</p><ul><li>A：更换 NDK 版本为文中所述的版本</li></ul></li><li><p>Q：文件命名</p><ul><li>A：由于安卓是基于 Linux 的，因此 Linux 的一些文件规范在安卓依然适用，如： <ul><li><ol><li>安卓是大小写敏感的，确保路径的大小写是正确的，否则将无法正确加载</li></ol></li><li><ol start="2"><li>文件夹或文件名中不要含有空格等字符</li></ol></li></ul></li></ul></li></ul><h2 id="特性与系统版本" tabindex="-1">特性与系统版本 <a class="header-anchor" href="#特性与系统版本" aria-label="Permalink to &quot;特性与系统版本&quot;">​</a></h2><p>不同的特性会依赖特定的系统版本，请往 <a href="./../../../advanced-topics/supported-versions.html">特性与系统版本</a> 查看详情。</p>',38),R=[j];function x(L,v,y,z,N,Y){return a(),i("div",null,R)}const U=o(X,[["render",x]]);export{T as __pageData,U as default};
